import React from "react";
import ".//App.css";
import {Link} from "react-router-dom";
import { BrowserRouter, Route, Switch } from "react-router-dom";


// asenna Firebase, react-router-dom, (motion), + muut tulevat lisäosat
function App() {
  return (
    <div>
      <p>
      Etusivu
      <br />
      Paina alla olevaa nappia.
      </p>
      <BrowserRouter>
      <Link to="/Kuvat">
      <button>
      Kuvat
      </button>
      </Link>
      </BrowserRouter>
    </div>
  );
}

export default App;
